import React, { useEffect, useState, useContext } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { MedContext } from '../internalMedContext';

const useStyles = makeStyles({
    table: {
      minWidth: 650,
    },
  });

  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }



const ViewInternalMed = () => {
    const classes = useStyles();
    const [values, setValues] = useContext(MedContext);

    const rows = [
        createData('name', values.name,),
        createData('Date Of Birth', Date(values.DateOfBirth).format('DD-MM-YYYY') ),
        createData('Height', values.height ),
        createData('Weight', values.weight),
        createData('Sex', values.sex),
      ];
    return (
        <div>
             <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">

        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>

            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
        </div>
    )
}
export default ViewInternalMed;
